import React, { Component } from 'react';


class ViewCoupon extends Component {
  state = {
    books: []
}

componentDidMount() {
    fetch('/api/hello')
    .then((response) => response.json())
    .then(booksList => {
        this.setState({ books: booksList });
    });
}


render() {
    return (
      <div >
       <h1>hekki</h1>
      </div>
    );
  }
}

export default ViewCoupon;
